const { Content } = Layout;

const List = (props) => {
    console.log(props);
    return (
        <ul>
            {
                props.shows.data.list.map((ele)=>{
                    return (
                        <li>{ele.ironDir}</li>
                    )
                })
            }
        </ul>
    )
}

export default List
